Stay in control of your Proximus account, anywhere and anytime!

The MyProximus app offers you an overview of your subscriptions and much more, at all times. It allows you to:
• keep track of your monthly data usage, calling minutes and text messages, or check your credit balance; 
• buy an additional mobile data volume if you have exceeded the data volume included in your mobile subscription; 
• consult and pay your bills directly via the app; 
• check or change the rate plan you have subscribed to;
• order mobile or TV options and manage those you have already activated;
• take advantage of lots of attractive TV promotions;
• top up your or a family member's Pay&Go card;
• choose the app (Facebook, Pinterest, Instagram, etc.) with which you can surf in an unlimited way in Belgium and the EU;
• view any appointments you have made with one of our technicians;
• keep track of your orders;
• manage several accounts; 
• easily manage the details linked to your account: change your profile photo, access your confidentiality settings, etc.
• easily find a solution to your problem thanks to our different support channels: chat, FAQs, helpline, tutorials, etc. 

Thank you for your support and suggestions! Your comments are very important to us and allow us to make the right improvements to our app. :-)
